GO

-- --------------------------------------------------------------------------------------------------
-- DEVCME-70-Add creation_date/last_update_date columns to every table in the offer service database
-- ---------------------------------------------------------------------------------------------------

IF Not EXISTS(
SELECT * FROM INFORMATION_SCHEMA.COLUMNS
WHERE TABLE_NAME='MainstreamSamples'
AND COLUMN_NAME ='Creation_Date')

ALTER TABLE [dbo].[MainstreamSamples]
ADD [Creation_Date] [DATETIME] NOT NULL DEFAULT (GETDATE())
Go
IF Not EXISTS(
SELECT * FROM INFORMATION_SCHEMA.COLUMNS
WHERE TABLE_NAME='MainstreamSamples'
AND COLUMN_NAME ='Update_Date')

ALTER TABLE [dbo].[MainstreamSamples]
ADD	[Update_Date] [DATETIME] NOT NULL DEFAULT (GETDATE())
GO
IF EXISTS (SELECT name FROM sysobjects
           WHERE name = 'trg_UpdateModified_MainstreamSamples' AND type = 'TR')
Drop TRIGGER trg_UpdateModified_MainstreamSamples
GO
CREATE TRIGGER trg_UpdateModified_MainstreamSamples
ON [dbo].[MainstreamSamples]
AFTER UPDATE
AS
        UPDATE t
            SET t.[Update_Date] = GETDATE()
            FROM [dbo].MainstreamSamples AS t 
            INNER JOIN inserted AS i 
            ON t.[OfferId] = i.[OfferId]  and  t.[StudyId] = i.[StudyId]  and t.[SampleId] = i.[SampleId] ;
Go	
IF Not EXISTS(
SELECT * FROM INFORMATION_SCHEMA.COLUMNS
WHERE TABLE_NAME='Offers'
AND COLUMN_NAME ='Creation_Date')

