-- --------------------------------------------------
-- Adding columns directly related to offer-service
-- Enable the known attributes for publishing
-- --------------------------------------------------
ALTER TABLE [dbo].[Attributes] ADD [Alias] [nvarchar](50) default '' NOT NULL;
ALTER TABLE [dbo].[Attributes] ADD [Publish] bit default 0 NOT NULL;
GO

update [Attributes] set [Publish] = 1, Alias = 'maritalStatus' where Id = 'BASCQ5';
update [Attributes] set [Publish] = 1, Alias = 'age' where Id = 'COREage';
update [Attributes] set [Publish] = 1, Alias = 'birthdate' where Id = 'COREbirthdate';
update [Attributes] set [Publish] = 1, Alias = 'gender' where Id = 'COREgender';
update [Attributes] set [Publish] = 1, Alias = 'language' where Id = 'CORElanguage';
update [Attributes] set [Publish] = 1, Alias = 'country' where Id = 'COREcontact_country';
update [Attributes] set [Publish] = 1, Alias = 'zipcode' where Id = 'COREcontact_zipcode';
update [Attributes] set [Publish] = 1, Alias = 'hispanicOrigin' where Id = 'GPPRQ10';
update [Attributes] set [Publish] = 1, Alias = 'race' where Id = 'GPPRQ16';
update [Attributes] set [Publish] = 1, Alias = 'HHincome' where Id = 'GPPRQ22';
GO

-- --------------------------------------------------
-- Define FOREIGN KEY constraints
-- --------------------------------------------------
ALTER TABLE [dbo].[AttributeOptions]  WITH CHECK ADD  CONSTRAINT [FK_AttributeOptions_AttributeId] FOREIGN KEY([AttributeId]) REFERENCES [dbo].[Attributes] ([Id]) ON UPDATE CASCADE
GO
ALTER TABLE [dbo].[AttributeOptions] CHECK CONSTRAINT [FK_AttributeOptions_AttributeId]
GO
ALTER TABLE [dbo].[RespondentAttributes] WITH CHECK ADD CONSTRAINT [FK_RespondentAttributes_AttributeId] FOREIGN KEY([Ident]) REFERENCES [dbo].[Attributes] ([Id]) ON UPDATE CASCADE
GO
ALTER TABLE [dbo].[RespondentAttributes] CHECK CONSTRAINT [FK_RespondentAttributes_AttributeId]
GO

-- Creating indexes
CREATE INDEX [IX_Attributes_Publish] ON [dbo].[Attributes] ([Publish]);
